### YamlMime:QSharpType
uid: microsoft.quantum.logical.notequalr
name: NotEqualR
type: function
namespace: Microsoft.Quantum.Logical
summary: Retorna true se e somente se duas entradas não forem iguais.
remarks: >-
  Os itens a seguir são equivalentes:


  ```Q#

  let cond = a != b;

  let cond = NotEqualR(a, b);

  ```
syntax: 'function NotEqualR (a : Result, b : Result) : Bool'
input:
  content: '(a : Result, b : Result)'
  types:
  - name: a
    summary: O primeiro valor a ser comparado.
    isPrimitive: true
    uid: Result
  - name: b
    summary: O segundo valor a ser comparado.
    isPrimitive: true
    uid: Result
output:
  content: Bool
  types:
  - summary: '`true` se `a` não for igual a `b`.'
    isPrimitive: true
    uid: Bool
